import React from 'react';
import PropTypes from 'prop-types';

import {Panel, PanelHeader, PanelHeaderBack, PanelHeaderClose} from '@vkontakte/vkui';

import './example.css';

const Example = props =>(
    <Panel id = {props.id}>
        <PanelHeader before={<PanelHeaderBack onClick={props.go} data-to="home"/>} after={<PanelHeaderClose onClick={props.go} data-to="user_menu"/>}>
            Persik
        </PanelHeader>


    </Panel>
);

Example.propTypes = {
    id: PropTypes.string.isRequired,
    go: PropTypes.func.isRequired,
};

export default Persik;
